import React, { Component } from 'react'
import { Link, Route } from 'react-router-dom'

import Home from './Components/Home'
import Youxitese from './Components/Youxitese'
import Shequapp from './Components/Shequapp'
import './css/App.css'

export default class App extends Component {
    // render() {
    //     return (

    //         <div>
    //             <Welcome />
    //         </div>
    //     )
    // }

    dengluzhuce = () => {
        console.log('登录注册');
    }

    render() {
        return (
            <div>
                <div className="row navHead">
                    <ul>
                        <li>
                            <div className='title'><h5>游戏网站</h5></div>
                        </li>
                        <li>
                            <Link className="list-group-item" to="/home" >首页</Link>
                        </li>
                        <li>
                            <Link className="list-group-item" to="/youxitese" >特色</Link>
                        </li>
                        <li>
                            <Link className="list-group-item" to="/shequapp" >社区</Link>
                        </li>
                        <li >
                            <button className='loginBtn' onClick={this.dengluzhuce}>登录/注册</button>
                        </li>
                    </ul>
                    {/* <div className="col-xs-offset-2 col-xs-8 head">
                    </div> */}
                </div>


                <div className="col-xs-6">
                    <div className="panel">

                        <Route path="/home" component={Home} />
                        <Route path="/youxitese" component={Youxitese} />
                        <Route path="/shequapp" component={Shequapp} />

                    </div>
                </div>
            </div>
        )
    }

}
